import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <h2>Accessibility Library</h2>
        <p>This is a project aimed at applying accesibility best practices to ui components using react.</p>
      </div>
    );
  }
}

export default Home;
